import React, { useState, useRef } from 'react';
import { CascadeSelect } from 'primereact/cascadeselect';

const DashboardPage = () => {

    const [selectedItem, setSelectedItem] = useState(null);
    const itemsHome = [
        {
            name: 'Casa',
            code: '1',
            items: [
                {
                    name: 'New South Wales',
                    codeitem: 1

                },
                {
                    name: 'Queensland',
                    codeitem: 2
                },

            ]
        },
        {
            name: 'Auto',
            code: '2',
            items: [
                {
                    name: 'Quebec',
                    codeitem: 3
                },
                {
                    name: 'Ontario',
                    codeitem: 4
                },

            ]
        }
    ];

  return (
    <>
    <div className='flex align-items-stretch flex-wrap justify-content-center'>
        <div className='grid'>
            <div class="field ">
                <label htmlFor="ddlCategory">Categor√≠a: </label>
                <CascadeSelect value={selectedItem} onChange={(e) => setSelectedItem(e.value)} options={itemsHome} 
                optionLabel="nameitem" optionGroupLabel="name" optionGroupChildren={['items']}
                className="w-full md:w-14rem" breakpoint="767px" placeholder="Item" style={{ minWidth: '14rem' }}  />
            </div>
        </div>
    </div>

    </>
  )
}

export default DashboardPage
